import React from "react";
import { ContentHeader } from 'config/C4';

const OverView = () => {
  return (
    <div className="overView">
      <div className="overView__container">
        <ContentHeader title='a few quick facts' link='/personal' arrow />
        <h1>Overview </h1>
      </div>
    </div>
  );
};

export default OverView;
